import react from "react";
import Cards from "./Cards.jsx";
import contacts from "./contacts";

function Cream(contact){
  return (
  <Cards

    name={contact.name}
    img={contact.imgURL}
    tel={contact.tel}
    email={contact.email}
  />
  );
}


function App() {
  return (
    <div>
      <h1>My contacts</h1>
      {contacts.map(Cream)}
    </div>
  );
}

export default App;
